(258840, 'esES', 'Un curioso objeto que Griftah recuperó de las Cámaras Mogu\'shan. Asegura que se suelta monedas de oro a chorros por un precio.', '', '', '', 'Fuente dorada', 65727),
(258136, 'esES', 'En pulsos ancestrales despiertan el trueno, que se retuerce en torno al pilar como un dragón que surca el cielo. No se trata del rugido de la destrucción, sino del estruendo del renacimiento, de la llamada a un nuevo ciclo.', '', '', '', 'Pilar de espiral de trueno azur', 65727),
(256141, 'esES', 'Una extraña criatura de buen augurio en Pandaria. Hay quienes dicen que, cuando saluda, ofrece riqueza y buena fortuna.', '', '', '', 'Gato saludador de la fortuna', 65727),
