INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'esES', 'Celestial dorado por la tormenta', '|cFFFFD200Tienda del juego|r', 'Revestido con trueno y elegido por el destino. Unos relámpagos dorados envuelven sus pezuñas y atraviesa el cielo como si le asestara un tajo a la noche. Cuentan las leyendas que tiene una estrecha relación con el emperador Shaohao.', 65727),
(2742, 'esES', 'Celestial Pezuña Trueno', '|cFFFFD200Tienda del juego|r', 'Tras la caída del Rey del Trueno, los remanentes de su trueno se fusionaron con el espíritu de un dragón blanco. Se desplaza sobre relámpagos azures mientras deja nubes arremolinadas a su paso: donde antaño reinó la tiranía, ahora perdura una luz guardiana.', 65727),
(2798, 'esES', 'Alatumba de bronce', '|cFFFFD200Logro: |rMaestro de Líneas Temporales Turbulentas IV|n|cFFFFD200Categoría: |rPaseo en el tiempo|n', 'Aunque lo oscuro y ominoso encaja con la estética preferida de los habitantes de Revendreth, hay quienes se decantan por un lustre reluciente.', 65727),
(2797, 'esES', 'Moscadáver de bronce', '|cFFFFD200Logro: |rMaestro de Líneas Temporales Turbulentas IV|n|cFFFFD200Categoría: |rPaseo en el tiempo', 'Decorar un moscadáver requiere mucho esfuerzo, pero hay quien diría que merece la pena.', 65727),
(2796, 'esES', 'Aquilon de bronce', '|cFFFFD200Logro: |rMaestro de Líneas Temporales Turbulentas IV|n|cFFFFD200Categoría: |rPaseo en el tiempo|n|n', 'Las fiables monturas de Bastión están diseñadas para imitar los orgullosos y nobles guerreros de los Ascendidos.', 65727),
(2795, 'esES', 'Salvajizo de bronce', '|cFFFFD200Logro: |rMaestro de Líneas Temporales Turbulentas IV|n|cFFFFD200Categoría: |rPaseo en el tiempo|n|n', 'Los salvajizos reales se arremolinan en el cielo, libres como la magia que hace posible que puedan volar.', 65727),
(1729, 'esES', 'Gran Resbalón en la Ciudad', '|cFFFFD200Misión:|r Ole ole los caracoles|n|cFFFFD200Zona: |rCaverna Zaralek', 'Gran corazón, grandes sueños, Gran Resbalón.', 65727);
